create table user_expenses
(
    id                        int unsigned auto_increment
        primary key,
    user_id                   int unsigned                       not null comment '用户ID',
    personal_expense_in_cents bigint unsigned                    not null comment '用户个人消费金额',
    team_expense_in_cents     bigint unsigned                    not null comment '用户团队（下级被邀请注册用户）消费金额，不含用户个人消费金额',
    created_at                datetime default CURRENT_TIMESTAMP not null,
    updated_at                datetime                           null,
    deleted_at                datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index user_expenses_user_id_index
    on user_expenses (user_id);

